// HasSubnet applies the HasEdge predicate on the "subnet" edge.
func HasSubnet() predicate.IpAddress {
	return predicate.IpAddress(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, SubnetTable, SubnetColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSubnetWith applies the HasEdge predicate on the "subnet" edge with a given conditions (other predicates).
func HasSubnetWith(preds ...predicate.Subnet) predicate.IpAddress {
	return predicate.IpAddress(func(s *sql.Selector) {
		step := newSubnetStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// HasDevice applies the HasEdge predicate on the "device" edge.
func HasDevice() predicate.IpAddress {
	return predicate.IpAddress(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, DeviceTable, DeviceColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasDeviceWith applies the HasEdge predicate on the "device" edge with a given conditions (other predicates).
func HasDeviceWith(preds ...predicate.Device) predicate.IpAddress {
	return predicate.IpAddress(func(s *sql.Selector) {
		step := newDeviceStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.IpAddress) predicate.IpAddress {
	return predicate.IpAddress(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.IpAddress) predicate.IpAddress {
	return predicate.IpAddress(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.IpAddress) predicate.IpAddress {
	return predicate.IpAddress(sql.NotPredicates(p))
}
